import React from "react";

import "./Card.css";
import Cover from "../Pictures/HD.png";

function Card() {
  return (
    <>
      <div className="page">
        <div className="container">
          <img className="cover" src={Cover} alt="Cover_Picture" />
        </div>
      </div>
    </>
  );
}

export default Card;
